  function initMap() {
    var myOptions = {
      center: new google.maps.LatLng(13.76247874977415, 100.5377984046936),
      zoom: 16,
      mapTypeControl: false,
      zoomControl: true,
      zoomControlOptions: {
          position: google.maps.ControlPosition.LEFT_BOTTOM
      },
      streetViewControl: true,
      streetViewControlOptions: {
        position: google.maps.ControlPosition.LEFT_BOTTOM
      }
    };
    map = new google.maps.Map(document.getElementById('map'),myOptions);
    var input = document.getElementById('searchLocation');
    var removeText = document.getElementById('clear');
    var myLocation = document.getElementById('mylocation');
    map.controls[google.maps.ControlPosition.TOP_LEFT].push(input);
    map.controls[google.maps.ControlPosition.TOP_LEFT].push(removeText);
    map.controls[google.maps.ControlPosition.RIGHT_BOTTOM].push(myLocation);
    var autocomplete = new google.maps.places.Autocomplete(input);
    autocomplete.bindTo('bounds', map);
    autocomplete.addListener('place_changed', function() {
      var place = autocomplete.getPlace();
      map.setCenter(place.geometry.location);
      map.setZoom(16);  
    });
    addMarkers();

  }//end function

  function removeMarkers(){

  function myLocation(){
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function(position) {
          var pos = {
              lat: position.coords.latitude,
              lng: position.coords.longitude
          };
          map.setCenter(pos);
        }, function() {
          alert("Error: The Geolocation service failed.");
        });
    } 
    else {
        // Browser doesn't support Geolocation
        alert("Browser doesn't support Geolocation");
    }
  }//end function
  function formatDate(date) {
      var d = new Date(date),
          month = '' + (d.getMonth() + 1),
          day = '' + d.getDate(),
          year = d.getFullYear();

      if (month.length < 2) month = '0' + month;
      if (day.length < 2) day = '0' + day;

      return [day, month, year].join('-');
  }
  function returnYear(date) {
      var d = new Date(date),
          year = d.getFullYear();

      return year;
  }
